import { Box } from "@mui/material";
import React from "react";

const ProductItem = ({ product }) => {
  return (
    <Box>
      <div className="product-image-container" key={product.id}>
        <img src={product.imgSrc} alt="E Tech World" />
        <div className="product-text text-center mb-4"></div>
      </div>
    </Box>
  );
};

export default ProductItem;
